import React from "react";
import Navigation from "../../components/navigation/navigation";
import Link from "../../components/link/link";
import { BoldSpan, LogoContainer, HomePageContainer, HomePageContentContainer } from "./homepage.styles";

const HomePage = () => {
  return (
    <HomePageContainer>
      <Navigation rightComponents={<Link to="/signin" />} />
      <HomePageContentContainer>
        <LogoContainer isMainFocus />
        <BoldSpan>AI Based Comment Analyzation Tool</BoldSpan>
      </HomePageContentContainer>
    </HomePageContainer>
  );
};

export default HomePage;
